import React from 'react';
import MyContext from '../components/MyContext';

class Cadastrados extends React.Component {
  constructor(props) {
    super(props);
    this.state = {  }
  }
  render() { 
    return (
      <div className="cadastradosContainer">
          <MyContext.Consumer>
            {
              value => {
                value.BDcadastro.map((pessoa) => (
                  <div>
                    <p>{pessoa.nome}</p>
                    <p>{pessoa.email}</p>                  
                  </div>
                ))
                // console.log(value.BDcadastro[0].nome);
              }
            }
          </MyContext.Consumer>
      </div>
    );
  }
}

export default Cadastrados;
